import Vue from 'vue'
import Router from 'vue-router'
import Home from './components/HelloWorld.vue'
import SampleComp from './components/SampleComp.vue'

Vue.use(Router)

export default new Router(
    {
        mode: 'history',
        routes: [
            {
                path: '/',
                name: 'home',
                component: Home
            },
            {
                path: '/sample',
                name: 'sample',
                component: SampleComp
            }
        ]
    }
)
